import React from "react";
import styles from "./Worker.module.css";
import { ListItemWrap } from "./ListItemWrap";

export const Worker = (props) => {
  return (
    <li className={styles["item-wrap"]}>
      {props.name}
      {props.surname}
      {props.gender}
      {props.birthDay}
      {props.salary}$
      {props.department}
    </li>
  );
};
